\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHis work had a very personal character, a stamp that made it recognizably his, the way a Picasso is recognizably a Picasso. He made imaginative leaps and discerned great principles through thought experiments rather than by methodical inductions based on experimental data. The theories that resulted were at times astonishing, mysterious, and counterintuitive, yet they contained notions that could capture the\n\nNovember 9, 2014\n\u001c24\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 9, 2014\n\u001c24\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNear the end of his life, Einstein was asked by the New York State Education Department what schools should emphasize. “In teaching history,” he replied, “there should be extensive discussion of personalities who benefited mankind through independence of character and judgment.”5 Einstein fits into that category.\n\nNovember 9, 2014\n\u001c25\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA society’s competitive advantage will come not from how well its schools teach the multiplication and periodic tables, but from how well they stimulate imagination and creativity.\n\nNovember 9, 2014\n\u001c25\n\u0011\n\u0011\n\n\nCHAPTER TWO Childhood, 1879–1896\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c. “The ordinary adult never bothers his head about the problems of space and time. These are things he has thought of as a child. But I developed so slowly that I began to wonder about space and time only when I was already grown up. Consequently, I probed more deeply into the problem than an ordinary child would have.”3\n\nNovember 9, 2014\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEinstein loved Aarau. “Pupils were treated individually,” his sister recalled, “more emphasis was placed on independent thought than on punditry, and young people saw the teacher not as a figure of authority, but, alongside the student, a man of distinct personality.” It was the opposite of the German education that Einstein had hated. “When compared to six years’ schooling at a German authoritarian gymnasium,” Einstein later said, “it made me clearly realize how much superior an education based on free action and personal responsibility is to one relying on outward authority.”57\n\nNovember 10, 2014\n\u001c47\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSure of himself, his gray felt hat pushed back on his thick, black hair, he strode energetically up and down in the rapid, I might say crazy, tempo of a restless spirit which carries a whole world in itself. Nothing escaped the sharp gaze of the large bright brown eyes. Whoever approached him was captivated by his superior personality.\n\nNovember 10, 2014\n\u001c49\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBeloved sweetheart! Many, many thanks sweetheart for your charming little letter, which made me endlessly happy. It was so wonderful to be able to press to one’s heart such a bit of paper which two so dear little eyes have lovingly beheld and on which the dainty little hands have charmingly glided back and forth. I was now made to realize,\n\nNovember 10, 2014\n\u001c49\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001clittle angel, the meaning of homesickness and pining. But love brings much happiness—much more so than pining brings pain . . . My mother has also taken you to her heart, even though she does not know you; I only let her read two of your charming little letters. And she always laughs at me because I am no longer attracted to the girls who were supposed to have enchanted me so much in the past. You mean more to my soul than the whole world did before.\n\nNovember 10, 2014\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHis admission report noted that he needed to do remedial work in chemistry and had “great gaps” in his knowledge of French. B\n\nNovember 10, 2014\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf I am lucky and pass my exams, I will enroll in the Zurich Polytechnic. I will stay there four years to study mathematics and physics. I suppose I will become a teacher in these fields of science, opting for the theoretical part of these sciences. Here are the reasons that have led me to this plan. They are, most of all, my personal talent for abstract and mathematical thinking ... My desires have also led me to the same decision. That is quite natural; everybody desires to do that for which he has a talent. Besides, I am attracted by the independence offered by the profession of science.70\n\nNovember 10, 2014\n\u001c53\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1zt4l2IcbGmljnB9oa7ErUxEzm7fwKgir1EDw_YE","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"10BhsCClLcXxHIGW_GSVPlWQ-DgJ07CymFmyjEBQ","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"