Il1qN8045Kp9uzHgWULUdb9yM">DOCS_modelChunk = [{"ty":"is","ibi":4432,"s":"\n\n\nCHAPTER THREE The Zurich Polytechnic, 1896–1900\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat depresses me most is the misfortune of my poor parents who have not had a happy moment for so many years. What further hurts me deeply is that as an adult man, I have to look on without being able to do anything. I am nothing but a burden to my family . . . It would be better off if I were not alive at all. Only the thought that I have always done what lay in my modest powers, and that I do not permit myself a single pleasure or distraction save for what my studies offer me, sustains me and sometimes protects me from despair.\n\nDecember 31, 2016\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEinstein’s new bohemian life and old self-absorbed nature made it unlikely that he would continue his relationship with Marie Winteler, the sweet and somewhat flighty daughter of the family he had boarded with in Aarau. At first, he still sent her, via the mail, baskets of his laundry, which she would wash and then return. Sometimes there was not even a note attached, but she would cheerfully try to please him. In one letter she wrote of “crossing the woods in the pouring rain” to the post office to send back his clean clothes. “In vain did I strain my eyes for a little note, but the mere sight of your dear handwriting in the address was enough to make me happy.”\n\nNovember 13, 2014\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI could never describe, because there are no words for it, how blissful I feel ever since the dear soul of yours has come to live and weave in my soul. I love you for all eternity, sweetheart.” But he wanted to break off the relationship. In one of his first letters after arriving at the Zurich Polytechnic, he suggested that they refrain from writing each other. “My love, I do not quite understand a passage in your letter,” she replied. “You write that you do not want to correspond with me any longer, but why not, sweetheart? ... You must be quite annoyed with me if you can write so rudely.” Then she tried to laugh off the problem: “But wait, you’ll get some proper scolding when I get home.” 23\n\nNovember 13, 2014\n\u001c63\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThroughout his life, Einstein would speak lovingly of the Zurich Polytechnic, but he also would note that he did not like the discipline that was inherent in the system of examinations. “The hitch in this was, of course, that one had to cram all this stuff into one’s mind for the examinations, whether one liked it or not,” he said. “This coercion had such a deterring effect that, after I had passed the final examination, I found the consideration of any scientific problems distasteful to me for an entire year.” 4\n\nNovember 13, 2014\n\u001c73\n\u0011\n\u0011\n\n\nCHAPTER FOUR The Lovers, 1900–1904\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWithout you, I lack self-confidence, pleasure in my work, pleasure in life—in short, without you my life is not life.\n\nNovember 13, 2014\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIndeed, he managed to become the only person graduating in his section of the Polytechnic who was not offered a job. “I was suddenly abandoned by everyone,” he later recalled. 12 By the end of October 1900 he and Mari were both back in Zurich, where he spent most of his days hanging out at her apartment, reading and writing. On his citizenship application that month, he wrote “none” on the question asking his religion, and for his occupation he wrote, “I am giving private lessons in mathematics until I get a permanent position.”\n\nNovember 13, 2014\n\u001c81\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBoth in Zurich and then in Milan, Einstein churned out job-seeking letters, ever more pleading, to professors around Europe. They were accompanied by his paper on the capillary effect, which proved not particularly impressive; he rarely even received the courtesy of a response. “I will soon have graced every physicist from the North Sea to the southern tip\n\nDecember 31, 2016\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBy April 1901, Einstein was reduced to buying a pile of postcards with postage-paid reply attachments in the forlorn hope that he would, at least, get an answer. In the two cases where these postcard pleas have survived, they have become, rather amusingly, prized collectors’ items. One of them, to a Dutch professor, is now on display in the Leiden Museum for the History of Science. In both cases, the return-reply attachment was not used; Einstein did not even get the courtesy of a rejection. “I leave no stone unturned and do not give up my sense of humor,”\n\nDecember 31, 2016\n\u001c85\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4491},{"ty":"te","id":"i.13","spi":5066},{"ty":"te","id":"i.14","spi":5776},{"ty":"te","id":"i.15","spi":6518},{"ty":"te","id":"i.16","spi":7112},{"ty":"te","id":"i.17","spi":7268},{"ty":"te","id":"i.18","spi":7841},{"ty":"te","id":"i.19","spi":8238},{"ty":"as","st":"paragraph","si":4432,"ei":4432,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4433,"ei":4433,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4434,"ei":4434,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_sa":11.25,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true,"ps_sb_i":true,"ps_sa_i":false,"ps_kwn_i":true,"ps_ifl_i":true}},{"ty":"as","st":"paragraph","si":4482,"