i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8204,"ei":8222,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8241,"ei":8804,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8805,"ei":8823,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="geIl1qN8045Kp9uzHgWULUdb9yM"  nonce="geIl1qN8045Kp9uzHgWULUdb9yM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="geIl1qN8045Kp9uzHgWULUdb9yM"  nonce="geIl1qN8045Kp9uzHgWULUdb9yM">DOCS_modelChunk = [{"ty":"is","ibi":8830,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 13, 2014\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEinstein’s father, with whom he was living in Milan, quietly shared his son’s anguish and tried, in a painfully sweet manner, to help. When no answer came after the second letter to Ostwald, Hermann Einstein took it upon himself, without his son’s knowledge, to make an unusual and awkward effort, suffused with heart-wrenching emotion, to prevail upon Ostwald himself:\n\nDecember 31, 2016\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 13, 2014\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPlease forgive a father who is so bold as to turn to you, esteemed Herr Professor, in the interest of his son. Albert is 22 years old, he studied at the Zurich Polytechnic for four years, and he passed his exam with flying colors last summer. Since then he has been trying unsuccessfully to get a position as a teaching assistant, which would enable him to continue his education in physics. All those in a position to judge praise his talents; I can assure you that he is extraordinarily studious and diligent and clings with great love to his science\n\nDecember 31, 2016\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe therefore feels profoundly unhappy about his current lack of a job, and he becomes more and more convinced that he has gone off the tracks with his career. In addition, he is oppressed by the thought that he is a burden on us, people of modest means. Since it is you whom my son seems to admire and esteem more than any other scholar in physics, it is you to whom I have taken the liberty of turning with the humble request to read his paper and to write to him, if possible, a few words of encouragement, so that he might recover his joy in living and working. If, in addition, you could secure him an assistant’s position, my gratitude would know no bounds. I beg you to forgive me for my impudence in writing you, and my son does not know anything about my unusual step\n\nDecember 31, 2016\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOstwald still did not answer. However, in one of history’s nice ironies, he would become, nine years later, the first person to nominate Einstein for the Nobel Prize.\n\nNovember 13, 2014\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBesso had a delightful intellect, but he lacked focus, drive, and diligence. Like Einstein, he had once been asked to leave high school because of his insubordinate attitude (he sent a petition complaining about a math teacher). Einstein called Besso “an awful weakling . . . who cannot rouse himself to any action in life or scientific creation, but who has an extraordinarily fine mind whose working, though disorderly, I watch with great delight.”\n\nDon\u0027t be besso. Be einstein\n\nDecember 31, 2016\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001crecommend Einstein. “I was deeply moved by your devotion and compassion, which did not let you forget your luckless friend,” Einstein replied. “I would be delighted to get such a nice job and that I would spare no effort to live up to your recommendation.” To Mari he exulted: “Just think what a wonderful job this would be for me! I’ll be mad with joy if something should come of that.” It would take months, he knew, before the patent-office job would materialize, assuming that it ever did. So he accepted a temporary post at a technical school in Winterthur for two months, filling in for a teacher on military leave. The hours would be long and, worse yet, he would have to teach descriptive geometry, neither then nor later his strongest field. “But the valiant Swabian is not afraid\n\nNovember 13, 2014\n\u001c90\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMost of all, he tried to be reassuring. He would find a job, he pledged, even if it meant going into the insurance business. They would create a comfortable home together. “Be happy and don’t fret, darling. I won’t leave you and will bring everything to a happy conclusion. You just have to be patient! You will see that my arms are not so bad to rest in, even if things are beginning a little awkwardly\n\nNovember 13, 2014\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe decision caused Einstein to focus on the future. “I will look for a position immediately, no matter how humble it is,” he told her. “My scientific goals and my personal vanity will not prevent me from accepting even the most subordinate position\n\nNovember 13, 2014\n\u001c93\n\u0011\n\u0011"},{"ty":"te","id":"i.20","spi":8839},{"ty":"te","id":"i.21","spi":8876},{"ty":"te","id":"i.22","spi":9284},{"ty":"te","id":"i.23","spi":9321},{"ty":"te","id":"i.24","spi":9912},{"ty":"te","id":"i.25","spi":10726},{"ty":"te","id":"i.26","spi":10931},{"ty":"te","id":"i.27","spi":11449},{"ty":"te","id":"i.28","spi":12277},{"ty":"te","id":"i.29","spi":12719},{"ty":"as","st":"paragraph","si":8830,"ei":8830,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8831,"ei":8831,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8832,"ei":8832,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8834,"ei":8834,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":8836,"ei":8836,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":8838,"ei":8838,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":8840,"ei":8840,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":false,"ps_sb_i":true,"ps_sa_i":true,"ps_kwn_i":true,"ps_al":1,"ps_ifl_i":true}},{"ty":"as","st":"cell","si":