 month, plus providing room and board. Einstein continued to promise Mari that she would “get a good husband as soon as this becomes feasible,” but he was now despairing about the patent job. “The position in Bern has not yet been advertised so that I am really giving up hope for it.”\n\nNovember 13, 2014\n\u001c101\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ce would be forever grateful to Grossmann, whose aid would continue in different ways over the next few years. “Grossmann is doing his dissertation\n\nNovember 13, 2014\n\u001c104\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFatherhood also focused him on the need to make some money while he waited to get the patent-office job. So the next day an ad appeared in the newspaper: “Private lessons in Mathematics and Physics . . . given most thoroughly by Albert Einstein, holder of the federal Polytechnic teacher’s diploma ... Trial lessons free.”\n\nNovember 13, 2014\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001carriving at work at 8 a.m., six days a week, and examining patent applications. “I am frightfully busy,” he wrote a friend a few months later. “Every day I spend eight hours at the office and at least one hour of private lessons, and then, in addition, I do some scientific work.” Yet it would be wrong to think that poring over applications for patents was drudgery. “I enjoy my work at the office very much, because it is uncommonly diversified.” 68\n\nNovember 13, 2014\n\u001c107\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAn academic career in which a person is forced to produce scientific writings in great amounts creates a danger of intellectual superficiality,”\n\nNovember 13, 2014\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEinstein announced that conversing freely was more fun than tutoring for pay. “You don’t have to be tutored in physics,” he said. “Just come see me when you want and I will be glad to talk with you.” They decided to read the great thinkers together and then discuss their ideas.\n\nNovember 13, 2014\n\u001c109\n\u0011\n\u0011\n\n\nCHAPTER SIX Special Relativity, 1905\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe simplest picture one can form about the creation of an empirical science is along the lines of an inductive method. Individual facts are selected and grouped together so that the laws that connect them become apparent ... However, the big advances in scientific knowledge originated in this way only to a small degree . . . The truly great advances in our understanding of nature originated in a way almost diametrically opposed to induction. The intuitive grasp of the essentials of a large complex of facts leads the scientist to the postulation of a hypothetical basic law or laws. From\n\nNovember 14, 2014\n\u001c151\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthese laws, he derives his conclusions. 29 His appreciation for this approach would grow. “The deeper we penetrate and the more extensive our theories become,” he would declare near the end of his life, “the less empirical knowledge is needed to determine those theories\n\nNovember 14, 2014\n\u001c152\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe new idea of local time, depending on the motion of the observer, was patched onto the old framework of absolute space and time defined by a rigid and immovable ether. Einstein, on the other hand, saw the old framework as cumbersome and unnecessary and was delighted to be rid of it. His version of the theory was simpler and more elegant. There was no absolute space and time and there was no ether. All the complicated explanations of electric and magnetic forces as elastic stresses in the ether could be swept into the dustbin of history, together with the famous old professors who still believed in them. 69 As a result, Poincaré\n\nNovember 14, 2014\n\u001c170\n\u0011\n\u0011"},{"ty":"te","id":"i.30","spi":13007},{"ty":"te","id":"i.31","spi":13823},{"ty":"te","id":"i.32","spi":14009},{"ty":"te","id":"i.33","spi":14371},{"ty":"te","id":"i.34","spi":14862},{"ty":"te","id":"i.35","spi":15046},{"ty":"te","id":"i.36","spi":15403},{"ty":"te","id":"i.37","spi":16036},{"ty":"te","id":"i.38","spi":16346},{"ty":"as","st":"paragraph","si":12998,"ei":12998,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":12999,"ei":12999,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":13000,"ei":13000,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":13002,"ei":13002,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":13004,"ei":13004,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":13006,"ei":13006,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":13008,"ei":13008,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":false,"ps_sb_i":true,"ps_sa_i":true,"ps_kwn_i":true,"ps_al":1,"ps_ifl_i":true}},{"ty":"as","st":"cell","si":13009,"ei":13009,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":fa