"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":16039,"ei":16310,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16311,"ei":16329,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":16349,"ei":16988,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16989,"ei":17007,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="geIl1qN8045Kp9uzHgWULUdb9yM"  nonce="geIl1qN8045Kp9uzHgWULUdb9yM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="geIl1qN8045Kp9uzHgWULUdb9yM"  nonce="geIl1qN8045Kp9uzHgWULUdb9yM">DOCS_modelChunk = [{"ty":"is","ibi":17015,"s":"\n\n\nCHAPTER SEVEN The Happiest Thought, 1906–1909\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut his post neither paid enough nor was important enough for him to give up his job at the patent office. His lectures at the University of Bern thus became simply one more thing for him to do. His topic for the summer of 1908 was the theory of heat, held on Tuesday and Saturday at 7 a.m., and he initially attracted only three attendees: Michele Besso and two other colleagues who worked at the postal building. In the winter session he switched to the theory of radiation, and his three coworkers were joined by an actual student named Max Stern. By the summer of 1909, Stern was the only attendee, and Einstein canceled his lecturing.\n\nNovember 14, 2014\n\u001c188\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI really did not lecture divinely,” Einstein lamented to a friend, “partly because I was not well prepared, partly because being investigated got on my nerves a bit.” Kleiner sat listening with a wrinkled brow, and after the lecture he informed Einstein that his teaching style was not good enough to qualify him for the professorship. Einstein calmly claimed that he considered the job “quite unnecessary.” 33 Kleiner went back to Zurich and reported that Einstein “holds monologues” and was “a long way from being a teacher.” That seemed to end his chances\n\nNovember 14, 2014\n\u001c189\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“So, now I too am an official member of the guild of whores,”\n\nNovember 14, 2014\n\u001c191\n\u0011\n\u0011\n\n\nCHAPTER EIGHT The Wandering Professor, 1909–1914\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInstead of prepared notes, Einstein used a card-sized strip of paper with scribbles. So the students got to watch him develop his thoughts as he spoke. “We obtained some insight into his working technique,” said Tanner. “We certainly appreciated this more than any stylistically perfect lecture.” At each step of the way, Einstein would pause and ask the students if they were following him, and he even permitted interruptions. “This comradely contact between teacher and student was, at that time, a rare occurrence,”\n\nNovember 14, 2014\n\u001c199\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSometimes he would take a break and let the students gather around him for casual conversation\n\nNovember 14, 2014\n\u001c200\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDo not laugh at me for writing you without having anything sensible to say. But I am so enraged by the base manner in which the public is presently daring to concern itself with you that I absolutely must give vent to this feeling. I am impelled to tell you how much I have come to admire your intellect, your drive, and your honesty, and that I consider myself lucky to have made your personal acquaintance in Brussels. Anyone who does not\n\nNovember 14, 2014\n\u001c213\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cnumber among these reptiles is certainly happy, now as before, that we have such personages among us as you, and Langevin too, real people with whom one feels privileged to be in contact. If the rabble continues to occupy itself with you, then simply don’t read that hogwash, but rather leave it to the reptile for whom it has been fabricated. 35\n\nNovember 14, 2014\n\u001c213\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cShe asked him to destroy her letters,\n\nNovember 14, 2014\n\u001c215\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhich he did. She, on the other hand, kept his responses for the rest of her life in a folder that she tied and later labeled “Especially beautiful letters from better days.”\n\nNovember 14, 2014\n\u001c215\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe is not a good teacher for mentally lazy gentlemen who merely want to fill a notebook and then learn it by heart for an exam; he is not a smooth talker, but anyone wishing to learn honestly how to develop his ideas in physics in an honest way, from deep within, and how to examine all premises carefully and see the pitfalls and the problems in his reflections, will find Einstein a first-class teacher, because all of this is expressed in his lectures, which force the audience to think along. 4\n\nNovember 16, 2014\n\u001c218\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001che and Elsa began to correspond as if they were a couple. She worried about his exhaustion and sent him a long letter prescribing more exercise, rest, and a healthier diet. He responded by saying that he planned to “smoke like a chimney, work like a horse, eat without thinking, go for a walk only in really pleasant company.”\n\nNovember 16, 2014\n\u001c224\n\u0011\n\u0011"},{"ty":"te","id":"i.39","spi":17072},{"ty":"te","id":"i.40","spi":17751},{"ty":"te","id":"i.41","spi":18349},{"ty":"te","id":"i.42","spi":18501},{"ty":"te","id":"i.43","spi":19060},{"ty":"te","id":"i.44","spi":19194},{"ty":"te","id":"i.45","spi":19674},{"ty":"te","id":"i.46","spi":20060},{"ty":"te","id":"i.47","spi":20137},{"ty":"te","id":"i.48","spi":20351},{"ty":"te","id":"i.49","spi":20889},{"ty":"as","st":"paragraph","si":17015,"ei":17015,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":17016,"ei":17016,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":17017,"ei":17017,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_sa":11.25,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true,"ps_sb_i":true,"ps_sa_i":false,"ps_kwn_i":true,"ps_ifl_i":true}},{"ty":"as","st":"paragraph","si":17063,"ei":17063,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_sa":11.25,"ps_il_i":true,"ps_sb":11.25,"ps_ir_i":true,"ps_al_i":true,"ps_sb_i":true,"ps_sa_i":true,"ps_hd":2,"ps_kwn_i":true,"ps_ifl_i":true}},{"ty":"as","st":"paragraph","si":17064,"ei":17064,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":tr