e,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="geIl1qN8045Kp9uzHgWULUdb9yM"  nonce="geIl1qN8045Kp9uzHgWULUdb9yM">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="geIl1qN8045Kp9uzHgWULUdb9yM"  nonce="geIl1qN8045Kp9uzHgWULUdb9yM">DOCS_modelChunk = [{"ty":"is","ibi":21246,"s":"\n\n\nCHAPTER NINE General Relativity, 1911–1915\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 16, 2014\n\u001c237\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 16, 2014\n\u001c237\n\u0011\n\u0011\n\n\nCHAPTER TEN Divorce, 1916–1919\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne of the strongest motives that leads men to art and science is escape from everyday life with its painful crudity and hopeless dreariness,” Einstein said. “Such men make this cosmos and its construction the pivot of their emotional life, in order to find the peace and security which they cannot find in the narrow whirlpool of personal experience.” 25\n\nNovember 16, 2014\n\u001c282\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cshe was to look after him. She told him when to eat and where to go. She packed his suitcases and doled out his pocket money. In public, she was protective of the man she called “the Professor” or even simply “Einstein.” That allowed him to spend hours in a rather dreamy state, focusing more on the cosmos than on the world around him. All of which gave her excitement and satisfaction. “The Lord has put into him so much that’s beautiful, and I find him wonderful, even though life at his side is enervating and difficult,” she once said. 64\n\nNovember 20, 2014\n\u001c298\n\u0011\n\u0011\n\n\nCHAPTER THIRTEEN The Wandering Zionist, 1920–1921\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Japanese people struck him as gentle and unpretentious, with a deep appreciation for beauty and ideas. “Of all the people I have met, I like the Japanese\n\nNovember 20, 2014\n\u001c365\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmost, as they are modest, intelligent, considerate, and have a feel for art,” he wrote his two sons. 77\n\nNovember 20, 2014\n\u001c365\n\u0011\n\u0011\n\n\nCHAPTER EIGHTEEN The Refugee, 1932–1933\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNever yet have I experienced from the fair sex such energetic rejection of all advances,\n\nNovember 20, 2014\n\u001c467\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEinstein spoke, in English, about the current menace to freedom, but he was careful not to attack the German regime specifically. “If we want to resist the powers that threaten to suppress intellectual and individual freedom, we must be clear what is at stake,” he said. “Without such freedom there would have been no Shakespeare, no Goethe, no Newton, no Faraday, no Pasteur, no Lister.” Freedom was a foundation for creativity. He also spoke of the need for solitude. “The monotony of a quiet life stimulates\n\nNovember 22, 2014\n\u001c494\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe creative mind,” he said, and he repeated a suggestion he had made when younger that scientists might be employed as lighthouse keepers so they could “devote themselves undisturbed” to thinking. 77\n\nNovember 22, 2014\n\u001c494\n\u0011\n\u0011\n\n\nCHAPTER TWENTY-ONE The Bomb, 1939–1945\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen he first arrived in Princeton, Einstein had been impressed that America was, or could be, a land free of the rigid class hierarchies and servility in Europe. But what grew to impress him more—and what made him fundamentally such a good American but also a controversial one—was the country’s tolerance of free thought, free speech, and nonconformist beliefs. That had been a touchstone of his science, and now it was a touchstone of his citizenship.\n\nJune 13, 2017\n\u001c556\n\u0011\n\u0011\n\n\nCHAPTER TWENTY-TWO One-Worlder, 1945–1948\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwould ever be lasting peace, Einstein answered, “No, as long as there will be man, there will be war.” At that moment Halsman clicked his shutter and captured Einstein’s sadly knowing eyes for what became a famous portrait (reproduced on page 487). 1\n\nNovember 22, 2014\n\u001c571\n\u0011\n\u0011"}
}'


